def pig_latin(string):
  vowels = ['a', 'e', 'i', 'o', 'u']
  words = string.split()
  pig_latin_words = []

  for word in words:
    if word[0].lower() in vowels:
      pig_latin_word = word + 'way'
    else:
      pig_latin_word = word[1:] + word[0] + 'ay'

    pig_latin_words.append(pig_latin_word)

  return ' '.join(pig_latin_words)


