from PythonGraph import PythonGraph

def main():
    graph = PythonGraph()

    # Set initial circle color and size
    circle_color = "red"
    circle_size = 10

    # Handle keyboard input
    def on_key_press(key):
        nonlocal circle_color
        nonlocal circle_size

        if key == "up":
            circle_size += 5
        elif key == "down":
            circle_size -= 5
        elif key == "r":
            circle_color = "red"
        elif key == "g":
            circle_color = "green"
        elif key == "b":
            circle_color = "blue"

    graph.on_key_press = on_key_press

    # Handle mouse click
    def on_left_mouse_down():
        graph.draw_circle(graph.mouse_x, graph.mouse_y, circle_size, circle_color)

    graph.on_left_mouse_down = on_left_mouse_down

    # Animation loop
    while graph.window_not_closed():
        graph.update_screen()

if __name__ == "__main__":
    main()

def count_tokens(filename):
    token_counts = {}
    with open(filename, 'r') as file:
        content = file.read()
        tokens = content.split()
        for token in tokens:
            if token in token_counts:
                token_counts[token] += 1
            else:
                token_counts[token] = 1
    return token_counts

def main():
    filename = input("Enter the name of a file: ")
    token_counts = count_tokens(filename)
    for token, count in token_counts.items():
        print(token, ":", count)

    search_token = input("Enter a token to search: ")
    if search_token in token_counts:
        print("The token", search_token, "appears", token_counts[search_token], "times.")
    else:
        print("The token", search_token, "appears 0 times.")

if __name__ == "__main__":
    main()

