def print_ascii_characters(first_char, second_char):
    ascii_start = min(ord(first_char), ord(second_char))
    ascii_end = max(ord(first_char), ord(second_char))

    if ascii_start < ascii_end:
        for ascii_value in range(ascii_start, ascii_end + 1):
            print(chr(ascii_value))
    else:
        for ascii_value in range(ascii_start, ascii_end - 1, -1):
            print(chr(ascii_value))


