from cs1lib import *

# initialize color and size of circle
circle_color = [1, 0, 0]
circle_size = 20

# initialize empty list to store circle information
circles = []

def draw_circle(x, y):
    # add circle's position, color, and size to list of circles
    circles.append((x, y, circle_color, circle_size))

def change_color(key):
    global circle_color

    # change circle color based on key pressed
    if key == "r":
        circle_color = [1, 0, 0]
    elif key == "g":
        circle_color = [0, 1, 0]
    elif key == "b":
        circle_color = [0, 0, 1]

def change_size(key):
    global circle_size

    # change circle size based on key pressed
    if key == "1":
        circle_size = 20
    elif key == "2":
        circle_size = 40
    elif key == "3":
        circle_size = 60

def mouse_press(mx, my):
    draw_circle(mx, my)

def key_press(key):
    change_color(key)
    change_size(key)

def draw_callback():
    clear()

    # draw all the circles in the list
    for x, y, color, size in circles:
        set_fill_color(color[0], color[1], color[2])
        draw_circle(x, y, size)

start_graphics(draw_callback, mouse_press=mouse_press, key_press=key_press)

